import React, { Component } from 'react';

class Home extends Component {
  render() {
    return (
      <div className="maintext">
          <h1 style={{paddingTop: '30px'}}>
	    This is my home webpage
	  </h1>
          <p>
            My name is Hua Zhou,now I work at NYU as a research scientist.
          </p>

      </div>
    );
  }
}

export default Home;
